import React from 'react';
import './EventPreview.css';
import { useNavigate } from 'react-router-dom';

const EventPreview = () => {
    const navigate = useNavigate();

    return (
        <div className='previewContainer'>
            <button className='eventAdvertisement' onClick = {()=>{navigate('/')}}>
                <div className='imageHolder'>
                    <image className='eventImage'/>
                </div>
                <div className='eventInfo'>
                    <div className='topInfo'>
                        <h1 className='eventTitle'>Eventfgdgdtitlefkjdfksfsdfdgdg</h1>
                        <p className='eventDate'><image />Dec 03</p>
                    </div>
                    <div classname='bottomInfo'>
                        <p className='eventDescription'>This is an example description of an event. This will call upon a database in the future to display information</p>
                        <p className='moreInfo'>click for more info...</p>
                    </div>
                </div>
            </button>
        </div>
    );
}

export default EventPreview;
